INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (1, 1.4, 0, 0, "ヒヨリでっす♪\n元気いっぱいがんばるよ♪", 0, 0, 1, "お！\nあそこに困ってそうな人発見！", "ねぇねぇ、騎士クン\n手伝ってあげようよ～", 2, 0, "春咲 ひより", 1, 1001);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (1, 1.4, 0, 0, "みんなみたいに\nわたしも強くならなきゃ", 0, 0, 1, "大切な人を\n守れるようになりたい…って", "わ、わたし、\nなに言ってるんだろ\nあはは…", 2, 0, "草野 優衣", 1, 1002);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (1, 1.4, 0, 0, "フェンシングを始めてみては？", 0, 0, 1, "キミに必要な集中力と感性が", "少しは磨かれると思いますよ。", 2, 0, "士条 怜", 1, 1003);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (1, 1.5, 0, 0, "ねぇ、にいちゃん！", 0, 0, 1, "今日はなにして遊ぶ？", "みそぎはねぇ、\nかくれんぼやりたい！", 2, 0, "穂高 みそぎ", 1, 1004);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (1, 1.4, 0, 0, "風宮あかりです", 0, 0, 1, "ねぇ…", "私といっしょに…\nいかない？", 2, 0, "風宮 あかり", 1, 1006);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (1, 1.5, 0, 0, "出雲宮子なのー", 0, 0, 1, "プリンたべたいのー", "食べ物の恨みは怖いのー", 2, 0, "出雲 宮子", 1, 1007);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (1, 1.4, 0, 0, "ボクは虹村雪。", 0, 0, 1, "キミもボクの美貌に\n吸い寄せられたんだね。", "いいよ。\n見られることは運命さ…", 2, 0, "虹村 雪", 1, 1008);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (1, 1.4, 0, 0, "フッ…聞いて後悔するがいい！", 0, 0, 1, "我が真名は\nアンネローゼ・フォン・シュテッヒパルム！", "人呼んで「疾風の冥姫」!!", 2, 0, "柊杏奈", 1, 1009);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (1, 1.5, 0, 0, "マホマホ王国のプリンセス、\nまほ姫どす", 0, 0, 1, "うさぎさん、\n運命の王子はんに巡りあわせてくれて", "ほんまおおきにやわ～♪", 2, 0, "姫宮 真歩", 1, 1010);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (1, 1.4, 0, 0, "衣之咲璃乃です！", 0, 0, 1, "生き別れたお兄ちゃんを探して\n三千世界！", "ここで会ったが\n100年目～！", 2, 0, "衣之咲 璃乃", 1, 1011);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (1, 1.4, 0, 0, "私はハツネ、\n結構強いんだよ。\nきらーん☆", 0, 0, 1, "ち、超能力って…\n何のことかな～？", "…って、お願い！\n誰にも言わないでおいて～！", 2, 0, "柏崎 初音", 1, 1012);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (1, 1.4, 0, 0, "ちょす！\n美波鈴奈だよ～♪", 0, 0, 1, "一応カリスマ読モJKやってまっす！", "ヒデサイまぢ\nGF（グッドフィーリング）～♪", 2, 0, "美波 鈴奈", 1, 1016);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (1, 1.4, 0, 0, "はいたーい。\n喜屋武香織さー。", 0, 0, 1, "東京は遊園地みたいなところさー", "でも、沖縄もとってもいいとこさー", 2, 0, "喜屋武 香織", 1, 1017);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (1, 1.4, 0, 0, "支倉伊緒です。", 0, 0, 1, "先生って呼ばれるのは\nくすぐったいから", "イオちゃんって呼んでね。", 2, 0, "支倉 伊緒", 1, 1018);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (1, 1.5, 0, 0, "ふえ…？\nミミ、むずかしいこと\nよくわかんない…", 0, 0, 1, "あ！/\お兄ちゃ～ん\nまってよ～", "ミミをおいてかないでぇ～", 2, 0, "茜 ミミ", 1, 1020);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (1, 1.5, 0, 0, "あ…あの…えっと…\n栗…林…くるみ…です……", 0, 0, 1, "あの……\nふぇ……", "ふぇぇぇぇぇん……", 2, 0, "栗林 くるみ", 1, 1021);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (1, 1.4, 0, 0, "風宮よりです。\nあああああ！", 0, 0, 1, "こんな私に貴重な時間を\n割いていただき、", "なんてありがとうございます！", 2, 0, "風宮 より", 1, 1022);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (1, 1.5, 0, 0, "私、アヤネ！\nぷうきちと一緒についてってあげるね！", 0, 0, 1, "おにいちゃんどこいくの？\nえ？", "私こっち行きたいー\nね、早く早くー", 2, 0, "北条 綾音", 1, 1023);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (1, 1.4, 0, 0, "わっ…わっ…私、\n天野すずめといいます！", 0, 0, 1, "ふ、不束者ですが\nどうぞ末永く…って、", "これて何か違う…\nあああすみません！", 2, 0, "天野 すずめ", 1, 1025);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (1, 1.4, 0, 0, "……クスクス…私は\n…倉石恵理子……", 0, 0, 1, "あなたは…運命の……\n伴侶……", "離しませんわ………\n絶対に…!!", 2, 0, "倉石 恵理子", 1, 1027);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (1, 1.4, 0, 0, "佐々木咲恋よ。\nねえ、世の中に無駄なことが\n多すぎると思わない？", 0, 0, 1, "その無駄を省くことができれば、\nもっと余裕のある暮らしができるっ！", "…そうでしょ？？", 2, 0, "佐々木 咲恋", 1, 1028);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (1, 1.4, 0, 0, "桜井望だよ！\nよろしくねっ", 0, 0, 1, "ぇっと…\nキミ、私のこと知らないの?!", "あはは、\n私もまだまだだなぁ～", 2, 0, "桜井 望", 1, 1029);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (1, 1.4, 0, 0, "デケデケデンっ！", 0, 0, 1, "初めまして、\n私はニノン・ジュベール申すデス！", "ショーグン、\nワタシと一緒に天下統一デース！", 2, 0, "ニノン・ジュベール", 1, 1030);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (1, 1.4, 0, 0, "上喜しのぶです。\n手元のドクロが父です。", 0, 0, 1, "でもって私の隣にいるのが……\nえ、見えない？", "おかしいですね……", 2, 0, "上喜 しのぶ", 1, 1031);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (1, 1.5, 0, 0, "目指すはビッグな\nお笑い芸人だっぺ！", 0, 0, 1, "けんども\nそれには足りないモンが…", "そう、\nオラのボケに突っ込める相方が…！", 2, 0, "野戸まひる", 1, 1033);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (1, 1.4, 0, 0, "あの…私…綾瀬ゆかりです…\nあの…ごめんなさい！", 0, 0, 1, "ちょっと緊張しちゃって…", "ちょ\nちょっと一杯飲んできます…！", 2, 0, "綾瀬 ゆかり", 1, 1034);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (1, 1.5, 0, 0, "氷川鏡華…です", 0, 0, 1, "知らない人とは話しちゃいけないので", "これ以上お話しすることは…\nないです！", 2, 0, "氷川 鏡華", 1, 1036);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (1, 1.4, 0, 0, "柏崎…栞です。", 0, 0, 1, "……あ、アラーム。", "私体が弱いから、\n30分に一度休憩しないと\nいけないんです。", 2, 0, "柏崎 栞", 1, 1038);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (1, 1.4, 0, 0, "ふ、双葉碧です。", 0, 0, 1, "私、一人も友達がいなくて……", "野に咲く花が、\n唯一の話相手です。", 2, 0, "双葉 碧", 1, 1040);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (1, 1.4, 0, 0, "三角千歌です。", 0, 0, 1, "私の歌声で、\n皆さんが幸せになってくれたらいいなって…", "そう思っています。", 2, 0, "三角 千歌", 1, 1042);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (1, 1.4, 0, 0, "安芸真琴だ。", 0, 0, 1, "あぁ？\nお前のそいつの仲間か？", "う、疑ってすまなかったな…", 2, 0, "安芸 真琴", 1, 1043);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (1, 1.4, 0, 0, "わらわこそは夜を総べる者！", 0, 0, 1, "生けとし生ける全ての者よ！", "わらわの偉大な力に\nひれ伏すがいい！\nはっはっは！", 2, 0, "イリヤ・オーンスタイン", 1, 1044);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (1, 1.4, 0, 0, "そこで騎士は妖精を乱暴に……", 0, 0, 1, "ぐふふふふ……はっ！", "ｌク、クウカに何かご用ですか!?", 2, 0, "遠見 空花", 1, 1045);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (1, 1.4, 0, 0, "宮坂たまきにゃ♪\n猫はいいにゃよ？", 0, 0, 1, "自由気ままで♪\n寝て遊んで、食べてケンカして…", "う～ん…\n猫ってホントに最高にゃ～♪", 2, 0, "宮坂たまき", 1, 1046);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (1, 1.4, 0, 0, "大神美冬よ！", 0, 0, 1, "それでは早速クエストに…", "…と思ったら\nバイトの時間だ！\nまたあとでね！", 2, 0, "大神 美冬", 1, 1048);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (1, 1.4, 0, 0, "星野静流だよ！", 0, 0, 1, "クエストもバトルも\n掃除も洗濯も", "お姉ちゃんがぜ～んぶ\nやってあげるからね！", 2, 0, "星野静流", 1, 1049);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (1, 1.5, 0, 0, "アタシは玉泉美咲。", 0, 0, 1, "見ての通りの\nセクシー美少女で", "学校では誰もが憧れる\nアイドル的な存在ってやつよ♪", 2, 0, "玉泉美咲", 1, 1050);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (1, 1.4, 0, 0, "？？？", 0, 0, 1, "？？？？", "？？？？", 2, 0, "リマ", 1, 1052);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (1, 1.5, 0, 0, "モニカ・ヴァイスヴィントだ。", 0, 0, 1, "菓子でつろうなどと\n稚拙な策を……", "そ、そこまでいうなら\nもらってやる", 2, 0, "モニカ・ヴァイスヴィント", 1, 1053);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (1, 1.5, 0, 0, "モニカ・ヴァイスヴィントだ。", 0, 0, 1, "菓子でつろうなどと\n稚拙な策を……", "そ、そこまでいうなら\nもらってやる", 2, 0, "ペコリーヌ", 1, 1058);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (1, 1.5, 0, 0, "モニカ・ヴァイスヴィントだ。", 0, 0, 1, "菓子でつろうなどと\n稚拙な策を……", "そ、そこまでいうなら\nもらってやる", 2, 0, "コッコロ", 1, 1059);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (1, 1.5, 0, 0, "モニカ・ヴァイスヴィントだ。", 0, 0, 1, "菓子でつろうなどと\n稚拙な策を……", "そ、そこまでいうなら\nもらってやる", 2, 0, "キャル", 1, 1060);
